import React from 'react';

function LoginPage () {
    return(
        <div className="loginPage">
            <div className="container">
                <h1>Login</h1>
                <input placeholder="username" type="text"/>
                <input placeholder="password" type="text"/>  
                <a>Sign Up</a>
            </div>
        </div>
    )
}

export default LoginPage;
